function getPackFeedbacks(n){const t=`${SiteName}/Api/PackFeedbacks/${n}`;fetch(t,{method:"GET",headers:{contentType:"application/json;charset=utf-8"}}).then(n=>n.ok?n.json():n.text().then(n=>{throw new Error(n);})).then(n=>{Array.isArray(n)?n.forEach(n=>{document.querySelector(".packages__description-"+n.pcC_PDLID).innerHTML=n.pcC_Comment,document.querySelector(".packages__date-"+n.pcC_PDLID).innerHTML="Traveled on: "+n.dep_date}):console.error("Invalid response format:",n)}).catch(n=>{console.error("Error fetching data of PackFeedbacks :",n.message)})}function showMoreSuggested(){const n=document.getElementById("suggestedList");n.classList.add("expanded");this.style.display="none"}$(function(){strPlcsIDs=$("#strPlcsIDs").val();const n=document.getElementById("suggestedButton");n.addEventListener("click",showMoreSuggested)});